import React from 'react'

// func hook = class
export default function Sports() {
  return (
    <div>
       <h2>Sports</h2>
    <ul>
        <img src="https://m.media-amazon.com/images/I/91d18dVdNQL._AC_UF1000,1000_QL80_.jpg" alt="Unbroken" width="200" height="200"/>
        <li>Book Name: Unbroken</li>
        <li>Author: Laura Hillenbrand</li>
    </ul>
    </div>
  )
}
